import { MDBCol, MDBContainer, MDBRow } from 'mdbreact'
import React, { Component } from 'react'

export default class Gallery extends Component {
    render() {
        return (
            <div>
              <div className="gallery is-section">
                  <MDBContainer>
                      <MDBRow>
                          <MDBCol></MDBCol>
                      </MDBRow>
                  </MDBContainer>
              </div>
            </div>
        )
    }
}
